pragma solidity ^0.4.25;
//��Լ����
contract VoteBase {
    //����ͶƱ�ߣ�����ͶƱ�߾߱�Ʊ�����Ƿ�ͶƱ��Ͷʲô�ļ����
    struct voter {
        uint Amount; //Ʊ���ͶƱ�����߱���Ʊ��
        bool Isvoted; //�Ƿ�ͶƱ
        uint vote;
    }

    //����ͶƱ��Ŀ�ṹ��������Ŀ��������������ǰ�ۼ�Ʊ��
    struct Project {
        bytes32 name;   //��Ŀ���ƻ�����
        uint votenum;   //Ʊ��
    }
    //����ͶƱ������
    address public persons;
    //����ַӳ�䵽ͶƱ����
    mapping (address => voter) public voters;
    //�鰸ָ��
    Project[] public Projects;

    function voteBase (bytes32[] ProjectsNames) public {
        persons = msg.sender;
        voters[persons].Amount = 1;

        for (uint i = 0; i < ProjectsNames.length; i++) {
            Projects.push(Project({
                name: ProjectsNames[i],
                votenum: 0
            }));
        }
    }

    //���ݵ�ַ����Ȩ��
    function givethevotetovoter (address voter) public {

        require(
            (msg.sender == persons) &&
            !voters[voter].Isvoted &&
            (voters[voter].Amount == 0)
            );
            voters[voter].Amount == 1;
    }
    //ͶƱ����
    function vote(uint project) public {
        voter storage sender = voters[msg.sender];
        require(!sender.Isvoted);
        sender.Isvoted = true;
        sender.vote = project;

        Projects[project].votenum += sender.Amount;
    }
    //�鰸��ʤ��
    function WinProject() public view
        returns (uint WinProject_) 
        {
            uint WinProjectCount = 0;
            for (uint p = 0; p < Projects.length; p++) {
                if (Projects[p].votenum > WinProjectCount) {
                    WinProjectCount = Projects[p].votenum;
                    WinProject_ = p;
                }
            }
        }


    //���Ʊ����ߵ���Ŀ
    function WinprojectShow() public view
        returns(bytes32 WinProjectName_) {
            WinProjectName_ = Projects[WinProject()].name;
        }
}
